import "./HeaderList.css";

const HeaderList = () => {
    return (
        <div className="header-list">
            <div></div>
            <div>Song Name</div>
            <div>Artist Name</div>
            <div>Track</div>
            <div></div>
        </div>
    )
}

export default HeaderList
